    function adaptiveHeight() {
        $('.choise-list').each(function(){
            if (!$(this).hasClass('list-img')) {
                var maxHeight = 0;
                var choiseItem = $(this).children('.choise-item.diff');
                choiseItem.outerHeight('auto');
                choiseItem.each(function () {
                    maxHeight = Math.max(maxHeight, parseInt($(this).outerHeight()));
                });
                choiseItem.outerHeight(maxHeight);
            }
        });
    }
